// import iconSupplements from '../../images/iconSupplements.png';
// import iconInjury from '../../images/iconInjury.png';
// import iconIllness from '../../images/iconIllness.png';
// import iconSkin from '../../images/iconSkin.png';
// import iconDisinfectant from '../../images/iconDisinfectant.png';
// import iconMedicalTools from '../../images/iconMedicalTools.png';

// import boldSupplements from '../../images/boldSupplements.png';
// import boldInjury from '../../images/boldInjury.png';
// import boldIllness from '../../images/boldIllness.png';
// import boldSkin from '../../images/boldSkin.png';
// import boldDisinfectant from '../../images/boldDisinfectant.png';
// import boldMedicalTools from '../../images/boldMedicalTools.png';

import { Link } from "react-router-dom";
import homeCategoriesJson from "../../data/homeCategories.json";

function HomeCategories() {

    const categoryList = homeCategoriesJson && homeCategoriesJson.map( category => {
        return(
            <div key={category.id}>
                <Col>
                    <Link
                    className="btn icon-btn"
                    to={{
                        pathname: `/products/${category.urlName}`
                    }}
                    >
                    <img className="icon supplements-main" src={category.defaultIcon} alt="Supplements category"/>
                    <img className="icon supplements-hover" src={category.hoverIcon} alt="Supplements category"/>
                    </Link>
                    <span className="caption">{category.categoryName}</span>
                </Col>
            </div>
        );
    });












    return(
        <>
            <div className="container section categories middle-title">
                <div className="row">
                    <div className="col">
                        <h3>Browse products by categories</h3>
                        <hr/>
                        <p className="description">Browse our diverse catalog featuring an extensive array of over 80 high-quality products across various categories to find the pharmaceutical solutions that best suit your needs.</p>
                    </div>
                </div>

                <div className="row cat-item">

                    <div className="col">
                        <Link 
                            to="/products/brain-boosters-memory-enhancers"
                            className="btn icon-btn"> 
                            <img className="icon supplements-main" src={iconSupplements} alt="Supplements category"/>
                            <img className="icon supplements-hover" src={boldSupplements} alt="Supplements category"/>
                        </Link>
                        <span className="caption">Supplements</span>
                    </div>

                    <div className="col">
                        <Link 
                            to="/products/blunt-trauma"
                            className="btn icon-btn"> 
                            <img className="icon injury-main" src={iconInjury} alt="Injury category"/>
                            <img className="icon injury-hover" src={boldInjury} alt="Injury category"/>
                        </Link>
                        <span className="caption">Injury</span>
                    </div>

                    <div className="col">
                        <Link 
                            to="/products/cough-cold"
                            className="btn icon-btn"> 
                            <img className="icon illness-main" src={iconIllness} alt="Illness category"/>
                            <img className="icon illness-hover" src={boldIllness} alt="Illness category"/>
                        </Link>
                        <span className="caption">Illness</span>
                    </div>


                    <div className="col">
                        <Link 
                            to="/products/dermatological"
                            className="btn icon-btn"> 
                            <img className="icon skin-main" src={iconSkin} alt="Dermatological category"/>
                            <img className="icon skin-hover" src={boldSkin} alt="Dermatological category"/>
                        </Link>
                        <span className="caption">Dermatological</span>
                    </div>

                    <div className="col">
                        <Link 
                            to="/products/disinfectants"
                            className="btn icon-btn"> 
                            <img className="icon disinfectant-main" src={iconDisinfectant} alt="Disinfectant category"/>
                            <img className="icon disinfectant-hover" src={boldDisinfectant} alt="Disinfectant category"/>
                        </Link>
                        <span className="caption">Disinfectant</span>
                    </div>

                    <div className="col">
                        <Link 
                            to="/products/medical-tools"
                            className="btn icon-btn"> 
                            <img className="icon tools-main" src={iconMedicalTools} alt="Medical tools category"/>
                            <img className="icon tools-hover" src={boldMedicalTools} alt="Medical tools category"/>
                        </Link>
                        <span className="caption">Medical Tools</span>
                    </div>
                </div>
            </div>
        </>
    );
}

export default HomeCategories;
